// frontend/src/pages/UserDashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Container } from 'react-bootstrap';

const UserDashboard = () => {
    return (
        <Container className="d-flex flex-column align-items-center justify-content-center" style={{ minHeight: '80vh' }}>
            <h1 className="display-5 fw-bold mb-3">Welcome to Your Dashboard</h1>
            <p className="lead text-muted mb-4">Ready to get something done?</p>
            <div>
                <Link to="/services">
                    <Button 
                        variant="primary" 
                        size="lg" 
                        style={{
                            background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', 
                            border: 'none',
                            padding: '0.8rem 2rem'
                        }}
                    >
                        Book a New Service
                    </Button>
                </Link>
            </div>
        </Container>
    );
};

export default UserDashboard;
